import React from "react";
import { Link } from "react-router-dom";

export default function CartHeaderBoneyM(props) {
  return (
    <header>
      <div>
        <Link to="/boneyM">
          <h1> Cart</h1>
        </Link>
      </div>
      <div></div>
    </header>
  );
}
